  false,\n\t\"url\": null,\n\t\"notes\": \"The data collection project assessed the
  economic performance of Hawaii-based longline vessels that made trips in 2005. Operational
  and vessel costs were collected by personal interviews with vessel owners, captains,
  and crew. Revenue information was generated from the Hawaii Department of Aquatic
  Resources dealer reports and NMFS logbooks (landings and fishing efforts).  The
  project estimated the cost-earnings for each individual longline vessels.  Cost-earnings
  data were also available for different vessel groups defined by species targeted
  (tuna-targeting only and tuna/swordfish-targeting). The project received a high
  response rate, obtaining data for 98 of the 125 active vessels in the fishery. Minling
  Pan was the Principle Investigator of this project.\",\n\t\"license_title\": null,\n\t\"extras\":
